import React, { useEffect, useState } from 'react';
import { obtenerAcciones } from '../api';

const AccionesRegistradas = () => {
  const [acciones, setAcciones] = useState([]);

  useEffect(() => {
    const fetchAcciones = async () => {
      try {
        const data = await obtenerAcciones();
        setAcciones(data);
      } catch (error) {
        console.error('Error al obtener las acciones:', error.message);
      }
    };

    fetchAcciones();
  }, []);

  return (
    <div>
      <h2>Acciones Registradas</h2>
      <table>
        <thead>
          <tr>
            <th>Nombre</th>
            <th>Número de Acciones</th>
            <th>Valor Inicial</th>
            <th>Precio Actual</th>
            <th>Ganancia/Pérdida</th>
          </tr>
        </thead>
        <tbody>
          {acciones.map((accion) => (
            <tr key={accion._id}>
              <td>{accion.nombre}</td>
              <td>{accion.numeroAcciones}</td>
              <td>{accion.valor}</td>
              <td>{accion.precioActual}</td>
              <td>{accion.ganancia}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default AccionesRegistradas;
